import * as React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
// import {makeStyles} from '@mui/material';

// const useStyles = makeStyles((theme) => ({
//     card: {
//       display: 'flex',
//       alignItems: 'center',
//       maxWidth: 375, 
//       margin: 5
//     },
//     title: {
//       flexGrow: 1,
//       marginRight: theme.spacing(2), 
//     },
//     body: {
//       flexGrow: 1, 
//     },
// }));

export default function StockCard() {
    // const classes = useStyles();
  return (
    <Card sx={{
      maxWidth: 375,
      margin: 5,
    }}>
      <CardContent >
        <div
          style={{
            display: 'flex',
            flexDirection: 'row',
          }}>
          <Typography variant="h5" component="div"
          style={{
            flex: 1,
            fontSize: '35px'
          }}>
            APOLO
          </Typography>
          <Typography variant="h5" component="div"
          style={{
            flex: 1,
            textAlign: 'right',
            fontSize: '40px'
          }}>
            0.2
          </Typography>
        </div>
      </CardContent>
      <CardContent>
        <Typography variant="h5" component="div">
          Apollo Hospital
        </Typography>
        <div>
          <Typography variant="body2" color="text.secondary">
            BSE Current Price: 125.5
          </Typography>
          <CardMedia
            component="img" // Use "img" for images, or "video" for videos
            height="140" // Set the desired height for the media content
            image="../assets/images/buy_arrow.png" // Replace this with the URL of your image or video
            alt="Image description" // Provide an accessible description for the media content
          />
        </div>
        <div>
          <Typography variant="body2" color="text.secondary">
            NSE Current Price: 125.7
          </Typography>
        </div>
      </CardContent>
      <CardActions>
        <Button size="small">Save</Button>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
  );
}
